import React from 'react';

class Header extends React.Component {
    render() {
        let loginArea = undefined;
        if (this.state.isLoggedIn) {
            loginArea = <p>hello, {this.state.userName}</p>
        } else {
            loginArea = <p>Please Login</p>
        }
        
        return (
            { loginArea }
        );
    }
}

export default Header;
